Operculum . Horny, near circular, of 4 slowly increasing whorls. Interior with small pimple-like projection in middle part (from
Abbott 1948
).

Anatomy (Based on the description and figures of
Abbott 1948
). Head-foot . Snout bilobed distally, cephalic tentacles long and slender, with 6–7 cilial tufts on small raised areas (described as serrations by
Abbott 1948
) on outer edge of left tentacle. Foot with rounded anterior end, laterally extended, with weak indentation, tapering posteriorly. Mucous slit at anterior edge, anterior mucous gland typical of family. Tentacles with black band near distal end. Light orange cells embedded in tentacles and just above right eye. Snout black other than anterior margin and broken clear streak mid-dorsally. Dorsal head asymmetrically coloured with dark grey to black on left side. Patches of grey on right side of neck and anterior lateral dorsal foot. Sides of foot ‘translucent whitish’ with few yellow or orange cells.

Penis . Well behind right tentacle, coiled for half turn when retracted. Long, narrow (in life), expanded distally with two glandular lobes: one adjacent to short distal part of penis, and larger oval outer lobe (
Abbott 1948 , fig. 5
). Tip narrow, bluntly pointed. Penial duct straight to slightly undulating, narrow throughout. Translucent and unpigmented except for few white cells in largest glandular lobe.
